import React from 'react';
import image from "../Image/image.png"
import Carousel from "react-grid-carousel";
const Card = () => {
    return (
        <div>

             <Carousel cols={3} rows={1} gap={8} loop>


                 <div class="cards">
                    <div class="card">
                             <h2 class="card-title">Room</h2>
                         <img src={image} alt=""/>
                        <p class="card-desc">Pinnipeds, commonly known as seals,[a] are a widely distributed and diverse clade of carnivorous, fin-footed, semiaquatic marine mammals. They comprise the extant families Odobenidae (whose only living member is the walrus.)</p>
                   </div>
            </div>


                </Carousel>
</div>

    );
};

export default Card;
